import React, { Component } from 'react';

class Rolodex extends Component {
  constructor(props) {
      super(props);
  }

  render () {
    return (
      <div>
        { this.props.data.map( element => <div key={element.id}>{element.name}</div>) }
      </div>
    );
  }
}

export default Rolodex;
